import React from 'react'
import AppListItem from './app-list-item'

const AppList = ({prop}) => {
  
  const elems = prop.map(() => {
    return <li><AppListItem  {...prop}/></li>
  });
  
  return (
      <ul>
        {elems}
      </ul>
    );
  };

  export default  AppList;
